import Theme from "../styles/theme"


function ForgotPassword() {

    return (
        <div className='forgotpass'>
            <div className='center'>

            </div>
            <style jsx>{`
                .forgotpass {
                    float: left;
                    height: 100%;
                    width: 100%;
                    display: grid;
                    justify-content: center;
                    align-items: center;
                }
                .center {
                    width: 300px;
                    height: 250px;
                    box-shadow: ${Theme.sh.mat};
                    border-radius: 6px;
                }
            `}</style>
        </div>
    )
}

export default ForgotPassword
